var title_f20_13_20690="Pathogenesis of angiodysplasias";
var content_f20_13_20690=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=GAST%2F76997&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=GAST%2F76997&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 478px\">",
"   <div class=\"ttl\">",
"    Proposed mechanism for the development of angiodysplasia",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 458px; height: 334px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    This cartoon depicts one possible explanation for the development of gastointestinal angiodysplasias. Mucosal and submucosal venous drainage is intermittently obstructed by muscular contraction or increased intraluminal pressure (panels A, B, and C). After many years of intermittent obstruction, submucosal veins may become dilated and tortuous (panel D) and involve additional veins and venules draining into the system. Eventually, the capillary ring dilates and the precapillary sphincter becomes incompetent resulting in a small arteriovenous communication lesion.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Boley SJ, Sammartano R, Adams R, et al. On the nature and etiology of vascular ectasias of the colon: Degenerative lesions of aging. Gastroenterology 1977; 72:650. Copyright &copy; 1977 Elsevier Science.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
