var title_f20_13_20692="Doppler echo cardiac tamponade";
var content_f20_13_20692=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F51257&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F51257&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Doppler echocardiogram in cardiac tamponade",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 329px; height: 495px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    In cardiac tamponade, the Doppler echocardiogram shows respiratory variation of left sided Doppler flow signals. Drift in ECG baseline identifies respiration. Panel A is recorded from the left ventricular outflow tract; the arrows denote the peak forward velocity of each beat, demonstrating that respiration causes a change in velocity that exceeds 25 percent. Panel B is obtained from the mitral inflow; the large and small arrows are the E and A waves, respectively. The E and A waves change in amplitude with respect to each other within each beat (ie E&gt;A or A&gt;E) and to their analogues in neighboring beats. The pattern of mitral inflow and E/A ratio are similar to those seen with the major types of diastolic dysfunction.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
